export default {
  async fetch(request) {
    const response = await fetch(request);

    // Clone the response so that it's no longer immutable
    const newResponse = new Response(response.body, response);

    // Add a custom header with a value
    newResponse.headers.append(
      "x-snippets-hello",
      "Hello from Cloudflare Snippets"
    );

    // Delete headers
    newResponse.headers.delete("x-header-to-delete");
    newResponse.headers.delete("x-header2-to-delete");

    // Adjust the value for an existing header
    newResponse.headers.set("x-header-to-change", "NewValue");
    return newResponse;
  },
};

query WorkerPlacementOverviewQuery(
    $accountTag: string
    $filter: ZoneWorkersRequestsFilter_InputObject
  ) {
    viewer {
      accounts(filter: { accountTag: $accountTag }) {
        workerPlacementAdaptiveGroups(limit: 100, filter: $filter) {
          sum {
            requests
            requestDuration
          }
        }
      }
    }
  }

query WorkerPlacementsQuery(
    $accountTag: string
    $filter: ZoneWorkersRequestsFilter_InputObject
  ) {
    viewer {
      accounts(filter: { accountTag: $accountTag }) {
        workerPlacementAdaptiveGroups(
          limit: 100
          filter: $filter
          orderBy: [requestDurationBucketMin100ms_DESC]
        ) {
          sum {
            requests
            requestDuration
          }
          dimensions {
            isSample
            requestDurationBucketMin100ms
          }
        }
      }
    }
  }

query apiTrafficDistribution($zoneTag: string, $filter: filter) {
    viewer {
      zones(filter: { zoneTag: $zoneTag }) {
        apiTraffic: httpRequestsAdaptiveGroups(limit: 2, filter: $apiFilter) {
          count
        }
        nonApiTraffic: httpRequestsAdaptiveGroups(limit: 100, filter: $filter) {
          count
        }
      }
    }
  }

query getBillableWorkersUsageQuery(
    $accountTag: string
    $filter: AccountWorkersOverviewDataAdaptiveGroupsFilter_InputObject!
  ) {
    viewer {
      accounts(filter: { accountTag: $accountTag }) {
        workersOverviewDataAdaptiveGroups(filter: $filter, limit: 10000) {
          dimensions {
            usageModel
          }
          sum {
            standardCpuTimeUs
